import Todos from "./components/Todos";
import Todo from "./models/todo";

function App() {
	const todos = [
		new Todo("learn react nigga"),
		new Todo("learn typescript my nigga"),
	];

	return (
		<div className="App">
			<Todos items={todos} />
		</div>
	);
}

export default App;
